// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auction {
    // Variables de estado
    address public owner;
    uint public initialPrice;
    uint public auctionEndTime;
    uint public highestBid;
    address public highestBidder;
    bool public ended;
    uint public extensionTime = 10 minutes;
    uint public extensionThreshold = 10 minutes;

    // Estructura para almacenar información de ofertas
    struct Bid {
        address bidder;
        uint amount;
    }
    
    // Mapeo para almacenar depósitos de los ofertantes
    mapping(address => uint) public deposits;
    Bid[] public bids;

    // Eventos
    event NewBid(address indexed bidder, uint amount);
    event AuctionEnded(address winner, uint amount);

    // Modificadores
    modifier onlyBeforeEnd() {
        require(block.timestamp < auctionEndTime, "La subasta ha finalizado.");
        _;
    }

    modifier onlyAfterEnd() {
        require(block.timestamp >= auctionEndTime, "La subasta sigue activa.");
        _;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Solo el propietario puede ejecutar esta funcion.");
        _;
    }

    // Constructor
    constructor() {
        owner = msg.sender;
        //initialPrice = _initialPrice;
        //auctionEndTime = block.timestamp + _duration;
        //highestBid = _initialPrice;
    }

    // Función para ofertar
    function bid() external payable onlyBeforeEnd {
        uint newBid = deposits[msg.sender] + msg.value;
        require(newBid > highestBid * 105 / 100, "La oferta debe ser al menos 5% mayor a la oferta actual.");

        deposits[msg.sender] = newBid;

        // Guardar la oferta en la lista de ofertas
        bids.push(Bid(msg.sender, newBid));

        // Actualizar la oferta más alta y el ofertante más alto
        highestBid = newBid;
        highestBidder = msg.sender;

        // Extender el plazo si faltan menos de 10 minutos
        if (auctionEndTime - block.timestamp < extensionThreshold) {
            auctionEndTime += extensionTime;
        }

        emit NewBid(msg.sender, newBid);
    }

    // Función para mostrar el ganador
    function showWinner() external view onlyAfterEnd returns (address, uint) {
        return (highestBidder, highestBid);
    }

    // Función para mostrar todas las ofertas
    function showBids() external view returns (Bid[] memory) {
        return bids;
    }

    // Función para finalizar la subasta
    function endAuction() external onlyOwner onlyAfterEnd {
        require(!ended, "La subasta ya ha sido finalizada.");
        ended = true;
        emit AuctionEnded(highestBidder, highestBid);
    }

    // Función para retirar depósitos
    function withdraw() external onlyAfterEnd {
        require(msg.sender != highestBidder, "El ganador no puede retirar.");
        uint refundAmount = deposits[msg.sender];
        require(refundAmount > 0, "No hay fondos para retirar.");

        // Calcular la comisión del 2% para gas
        uint fee = refundAmount * 2 / 100;
        uint finalAmount = refundAmount - fee;
        deposits[msg.sender] = 0;
        
        (bool success, ) = msg.sender.call{value: finalAmount}("");
        require(success, "El retiro fallo.");
    }

    // Función para retirar parcial durante la subasta
    function partialWithdraw(uint amount) external onlyBeforeEnd {
        require(deposits[msg.sender] >= amount, "No tienes suficiente deposito.");
        deposits[msg.sender] -= amount;

        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "El retiro fallo.");
    }
}

